.anim {
  transition: all 0.33s ease-in-out;
  -webkit-transition: all 0.33s ease-in-out;
  -moz-transition: all 0.33s ease-in-out;
}

.buttons-section-wrapper {
  position: absolute;
  left: 0;
  top: 0;
  width: 100%;
  height: 100vh;
  overflow: hidden;
  color: #fff;
  z-index: 10;
}

.roulette-section-wrapper {
  position: absolute;
  left: 0;
  top: 0;
  width: 100%;
  height: 100vh;
  overflow: hidden;
  color: #fff;
  z-index: 10;
  background: radial-gradient(
    61.53% 61.53% at 50% 50%,
    rgba(23, 37, 72, 0) 0%,
    rgba(22, 21, 43, 0.88) 100%
  );
}

.cg1-buttons-grid {
  position: absolute;
  bottom: @60px;
  left: @60px;
  display: flex;
  align-items: center;
  width: auto;
  justify-content: flex-end;
}

.cg1-buttons-grid-right {
  position: absolute;
  bottom: @100px !important;
  right: @40px;
  width: auto;
  display: flex;
  align-items: center;
  justify-content: flex-end;
  z-index: 10;
}
.cg1-buttons-grid-left {
  position: absolute;
  top: @60px;
  left: @60px;
  width: auto;
  display: flex;
  align-items: flex-start;
  flex-direction: column;
  justify-content: flex-start;
  z-index: 10;
}

.casino-button-info-item {
  display: flex;
  align-items: center;
  margin-top: @24px;

  &:first-child {
    margin: 0;
  }

  .cg1-but-icon {
    background: rgba(255, 255, 255, 0.1);
    border-radius: @6px;
    width: @46px;
    min-width: @46px;
    height: @46px;
    display: flex;
    align-items: center;
    justify-content: center;
    margin-right: @12px;
    border: 0 !important;

    img {
      width: @24px;
      min-width: @24px;
      height: @24px;
    }

    &:nth-child(2) {
      margin-right: @24px;
    }
  }

  p {
    font-style: normal;
    font-weight: 600;
    font-size: @14px;
    line-height: 100%;
  }

  .cg1-keyboard {
    background: rgba(255, 255, 255, 0.1);
    border: 0 !important;
    border-radius: @6px;
    width: @104px;
    height: @46px;
    text-align: center;
    display: flex;
    align-items: center;
    justify-content: center;
    font-size: @14px;
    &.cube {
      width: @46px;
      img {
        width: @32px;
        height: @32px;
      }
    }
  }
}

@keyframes rotation360 {
  from {
    transform: rotate(0deg);
  }

  to {
    transform: rotate(360deg);
  }
}

.rotation360 {
  animation-name: rotation360;
}

.casino-game-main-button {
  width: @470px;
  height: @110px;
  background: linear-gradient(90deg, #f02687 0%, #ff314a 100%);
  box-shadow: 0px @4px @30px #7a0528, 0px 0px 0px @6px #b60c3f;
  border-radius: @4px;
  position: relative;
  display: flex;
  align-items: center;
  justify-content: center;
  .anim;

  p {
    font-style: normal;
    font-weight: normal;
    font-size: @24px;
    line-height: 100%;
    letter-spacing: @4px;
    text-transform: uppercase;
    color: #ffffff;
    display: flex;
    transform: translateY(-30%);
    .anim;
    small {
      display: block;
      font-size: @12px;
      position: absolute;
      left: 50%;
      transform: translateX(-50%);
      top: 100%;
    }
  }

  & > img {
    width: @242px;
    height: @242px;
    position: absolute;
    left: 50%;
    top: 50%;
    transform: translate(-50%, -50%);
    pointer-events: none;
    user-select: none;
    .anim;
  }

  span {
    position: absolute;
    width: 100%;
    height: 100%;
    left: 0;
    top: 0;
    overflow: hidden;
    border-radius: @4px;
    pointer-events: none;
    user-select: none;

    i {
      width: 100%;
      height: auto;
      position: absolute;
      left: 50%;
      top: 50%;
      transform: translate(-50%, -50%);
      opacity: 0.2;

      & > img {
        width: 100% !important;
        margin: 0 !important;
        animation-iteration-count: infinite;
        animation-timing-function: linear;
        animation-duration: 30s;
        -webkit-animation-fill-mode: both;
        animation-fill-mode: both;
        animation-name: rotation360;
        .anim;
      }
    }
  }

  &:hover {
    box-shadow: 0px @6px @30px #b60c3f, 0px 0px 0px @8px #b60c3f;

    p {
      text-shadow: 0 0 @30px white;
    }
  }
}

.cg1-middle-bottom-wrapper {
  position: absolute;
  bottom: @140px;
  left: 50%;
  transform: translateX(-50%);
  display: flex;
  flex-direction: column;
  justify-content: flex-end;
  align-items: center;
  z-index: 10;
}
.cg1-right-bottom-wrapper {
