    bottom: @180px;
  }
}

.cg1-up-down {
  display: flex;
  align-items: center;
  justify-content: center;
  margin-bottom: @16px;
  .anim;

  .cg1-but-icon {
    width: @46px;
    height: @28px;
    display: flex;
    align-items: center;
    justify-content: center;
    background: rgba(255, 255, 255, 0.1);
    border-radius: @4px 0px 0px @4px;
    margin-right: @4px;
    cursor: pointer;
    .anim;
    user-select: none;

    &:hover {
      background: rgba(255, 255, 255, 0.3);
      transform: scale(1.1, 1.1);
    }

    &:active {
      position: relative;
      top: @2px;
    }

    &:last-child {
      border-radius: 0px @4px @4px 0px;
      margin: 0;
    }

    img {
      width: @24px;
      height: @24px;
    }
  }
}

