  }
}

.cgc-grid-buy {
  display: grid;
  grid-template-columns: 1fr 1fr;
  grid-template-rows: 1fr 1fr;
  grid-gap: @40px;
  width: 100%;
  margin-bottom: @50px;

  & > button {
    width: 100%;
    height: @200px + @20px;
    background: rgba(255, 255, 255, 0.1);
    border-radius: @6px;
    padding: @50px;
    text-align: left;
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    align-items: flex-start;
    .anim;
    overflow: hidden;
    position: relative;

    &:after {
      content: "Купить";
      font-size: @14px;
      letter-spacing: @4px;
      text-transform: uppercase;
      color: #fff;
      position: absolute;
      right: -50%;
      bottom: 50%;
      transform: rotate(-90deg) translateX(0%);
      transform-origin: center bottom;
      .anim;
    }

    &.blue {
      background: #2f80ed;

      &:hover {
        transform: scale(1.1, 1.1) rotate(2deg);
        background: #2f80ed;
        box-shadow: @24px 0 @60px #2f80ed;
      }
    }

    &.purple {
      background: #9b51e0;

      &:hover {
        transform: scale(1.1, 1.1) rotate(2deg);
        background: #9b51e0;
        box-shadow: @24px 0 @60px #9b51e0;
      }
    }

    &:hover {
      transform: scale(1.1, 1.1) rotate(2deg);
      background: rgba(255, 255, 255, 0.2);

      &:after {
        right: 0;
      }
    }

    &:active {
      position: relative;
      top: @2px;
    }
  }
}

