// DICE

.dice-section-wrapper {
  position: absolute;
  left: 0;
  top: 0;
  width: 100%;
  height: 100vh;
  overflow: hidden;
  color: #fff;
  z-index: 10;
  background: radial-gradient(
    61.53% 61.53% at 50% 50%,
    rgba(23, 37, 72, 0) 0%,
    rgba(22, 21, 43, 0.88) 100%
  );
  &.croupier-wrapper {
    .cg-timer {
      top: 40%;
    }
    .dice-players {
      bottom: auto;
      top: 0;
    }
    .fly-dice-shadow {
      left: 0;
      top: 0;
      bottom: auto;
      background: linear-gradient(0deg, rgba(27, 137, 117, 0) 0%, #3a8167 100%);
    }
    .dice-player-item {
      justify-content: flex-start;
      margin: 0 @4px;
      &:after {
        transform: rotate(180deg);
        transform-origin: center center;
      }
      .dpi-timer {
        bottom: @30px;
        top: auto;
        left: @30px;
      }
    }
  }
}
.dice-bid {
  position: absolute;
  top: 0;
  left: 50%;
  width: @320px;
  height: @160px;
  display: flex;
  align-items: center;
  justify-content: center;
  flex-direction: column;
  transform: translate(-50%, 0);
  background: linear-gradient(0deg, rgba(0, 0, 0, 0) 0%, #00000067 100%);
}

.dice-players {
  position: absolute;
  bottom: 0;
  transform: translateX(-50%);
  left: 50%;
  display: flex;
  align-items: flex-end;
  justify-content: center;
  width: 100%;
  .fly-dice-shadow {
    position: absolute;
    width: 100%;
    height: @220px;
    left: 0;
    bottom: 0;
    background: linear-gradient(180deg, rgba(27, 137, 117, 0) 0%, #3a8167 100%);
    z-index: 1;
  }
  .dice-player-item {
    width: @320px;
    height: @400px;
    display: flex;
    flex-direction: column;
    justify-content: flex-end;
    align-items: center;
    padding: @30px @30px @40px;
    margin: 0 @20px;
    text-align: center;
    position: relative;
    .anim;
    z-index: 10;
    &:after {
      content: "";
      position: absolute;
      left: 0;
      top: 0;
      width: 100%;
      height: 100%;
      .anim;
      background: linear-gradient(
        180deg,
        rgba(0, 255, 209, 0) 0%,
        #268a66 100%
      );
      opacity: 0.10;
    }
    &.dpi-wait {
      &:after {
        opacity: 0.30;
      }
    }
    &.dpi-ready {
      &:after {
        opacity: 0.60;
      }
    }
    &.dpi-dice {
      &:after {
        opacity: 1.0;
      }
    }
    &.dpi-ok {
      &:after {
        opacity: 0.8;
      }
    }



    &.seat-0 {
      &:after {
        background: linear-gradient(180deg, rgba(0, 255, 209, 0) 0%, #268A66 100%);
      }
    }
    &.seat-1 {
      &:after {
        background: linear-gradient(180deg, rgba(158, 255, 0, 0) 0%, #9DC822 100%);
      }
    }
    &.seat-2 {
      &:after {
        background: linear-gradient(180deg, rgba(255, 31, 0, 0) 0%, #FF3838 100%);
      }
    }
    &.seat-3 {
      &:after {
        background: linear-gradient(180deg, rgba(0, 56, 255, 0) 0%, #8922C8 100%);
      }
    }

    .dpi-bid,
    .casino-mini-font {
      position: relative;
      z-index: 10;
    }

    .dpi-name {
      font-style: normal;
      font-weight: 800;
      font-size: @24px;
      line-height: 100%;
      text-align: center;
      color: #ffffff;
      text-shadow: 0px @4px @24px rgba(255, 255, 255, 0.25);
      position: relative;
      z-index: 10;
    }
    .dpi-enter {
      height: @50px;
      width: 100%;
      display: flex;
      align-items: center;
      justify-content: center;
      position: relative;
      z-index: 10;
    }
    .dpi-timer {
      display: flex;
      align-items: center;
      justify-content: center;
      width: 100%;
      border-radius: @4px;
      overflow: hidden;
      position: absolute;
      top: @30px;
      left: @30px;
      width: @260px;
      z-index: 10;

      & > div {
        font-weight: bold;
        font-size: @18px;
        line-height: 100%;
        text-align: center;
        text-transform: uppercase;
        color: #ffffff;
        text-shadow: 0px @4px @14px rgba(255, 255, 255, 0.25);
        height: @44px;
        &:first-child {
          background: rgba(52, 209, 158, 0.3);
          width: 100%;
          display: flex;
          align-items: center;
          justify-content: center;
        }
        &:last-child {
          background: rgba(52, 209, 158, 0.2);
          width: @100px;
          display: flex;
          align-items: center;
          justify-content: center;
        }
      }
    }
  }
}

.dpi-button {
  width: @180px;
  height: @50px;
  padding: 0 @10px;
  background: #34d19e;
  border-radius: @4px;
  overflow: hidden;
  display: flex;
  align-items: center;
  justify-content: center;
  position: relative;
  z-index: 10;
  .anim;
  &:disabled {
    pointer-events: none;
  }
  &:hover {
    transform: scale(1.1, 1.1);
  }
  &:active {
    top: @2px;
  }
  img {
    width: @30px;
    height: @30px;
  }
  p {
    font-size: @18px;
    line-height: 100%;
    text-align: center;
    text-transform: uppercase;
    color: #ffffff;
    font-weight: bold;
    .anim;
  }

  &.border {
    border: 1px solid rgba(255, 255, 255, 0.2);
    background: transparent;
    img {
      opacity: 0;
      .anim;
      position: absolute;
    }
  }
  &.to-success {
    width: @50px;
    padding: 0;

    p {
      opacity: 0;
      position: absolute;
    }
    img {
      opacity: 1;
      position: relative;
    }
  }
}
.dice_roll_shadow {
  position: absolute;
  z-index: 1;
  width: 100%;
  height: 100%;
  background: radial-gradient(61.53% 61.53% at 50% 50%, #172548 0%, rgba(22, 21, 43, 0.45) 100%);
}
.dice-cast-wrapper {
  position: absolute;
  z-index: 90;
  width: 100%;
  height: 100%;
  //background: radial-gradient(61.53% 61.53% at 50% 50%, #172548 0%, rgba(22, 21, 43, 0.45) 100%);
}
.cg-dice-z {
  position: absolute;
  z-index: 200;
}

.dice-container {
  width: 300px;
  height: 300px;
  position: relative;
  perspective: 1000px;
  cursor: grab;
  z-index: 999;
  transition: transform 0.2s ease;
  &:hover {
    transform: scale(0.98);
  }
}

.dice-item {
  width: 100%;
  height: 100%;
  position: absolute;
  transform-style: preserve-3d;
  transition: transform 1s;
  figure {
    width: 198px;
    height: 198px;
    display: block;
    position: absolute;
    border: 1px solid #000;
    box-shadow: inset 0 0 40px rgba(0, 0, 0, 0.8);
    //border-radius: 10px;
    text-align: center;
    line-height: 200px;
    font-size: 60px;
    background-color: #fff;
    .unselectable;
  }
}

.dice-item .front {
  transform: rotateY(0deg) translateZ(100px);
  background-image: url("./assets/img/dice/dice-1.png");
}
.dice-item .top {
  transform: rotateX(90deg) translateZ(100px);
  background-image: url("./assets/img/dice/dice-2.png");
}
.dice-item .left {
  transform: rotateY(-90deg) translateZ(100px);
  background-image: url("./assets/img/dice/dice-3.png");
}
.dice-item .right {
  transform: rotateY(90deg) translateZ(100px);
  background-image: url("./assets/img/dice/dice-4.png");
}
.dice-item .bottom {
  transform: rotateX(-90deg) translateZ(100px);
  background-image: url("./assets/img/dice/dice-5.png");
}
.dice-item .back {
  transform: rotateX(180deg) translateZ(100px);
  background-image: url("./assets/img/dice/dice-6.png");
}

//These classes changes with jQuery and makes the dice to roll
.dice-item.show-front {
  transform: translateZ(-100px) rotateY(0deg);
}
.dice-item.show-top {
  transform: translateZ(-100px) rotateX(-90deg);
}
.dice-item.show-left {
  transform: translateZ(-100px) rotateY(90deg);
}
.dice-item.show-right {
  transform: translateZ(-100px) rotateY(-90deg);
}
.dice-item.show-bottom {
  transform: translateZ(-100px) rotateX(90deg);
}
.dice-item.show-back {
  transform: translateZ(-100px) rotateX(-180deg);
}

.dice-item.show-same {
  transform: translateZ(-100px) rotateX(360deg);
}
.unselectable() {
  -webkit-user-select: none;
  -moz-user-select: none;
  -ms-user-select: none;
}
